    <details className={classes.details} key={genero.tipo}>
        <summary>{genero.tipo}</summary>
        <form>
            <label>1.<input type="checkbox"/></label>
            <label>2.<input type="checkbox"/></label>
            <label>3.<input type="checkbox"/></label>
            <label>4.<input type="checkbox"/></label>
            <label>5.<input type="checkbox"/></label>
        </form>
    </details>
    
    ))
    return ( 
        <div className={classes.GeneroYColor}>
            <h2>Elija un g√©nero</h2>
            <div>
                {options}
            </div>
 
             </div>
     );
}
 
export default GenerosYColores;
